On Escalation Ticket # 00430399 the new comment has been added: Ethan Israel:

@Salesforce @Helen Randall -  just a heads up, we haven't had a chance for dev to triage this one yet but this is marked for discussion/triage on our refinement call tomorrow, will provide updates and ETA after that call.

[DevOps CommentId:11455892]

On Escalation Ticket # 00430399 the new comment has been added: Ethan Israel:

@Salesforce @Helen Randall - this has been refined with dev. We will need to upgrade apache struts to the latest version to address this but will first need to investigate whether there are any compatibility issues or other updates that would be needed with that upgrade. I expect to be able to pull the investigation onto the dev sprint starting 1/22. 

[DevOps CommentId:11458893]

On Escalation Ticket # 00430399 the new comment has been added: Ethan Israel:

@Salesforce @Helen Randall - the work item to address this is still on the backlog, however I wanted to mention that the offending file (struts2-core-6.3.0.2.jar)  is only used in the Survey Action Module. If the customer is not using the Survey Action Module they can safely remove/delete that file. 

[DevOps CommentId:11471404]

